export function Name() { return "OpenRGB Bridge"; }
export function Version() { return "1.1.0"; }
export function Type() { return "network"; }
export function Publisher() { return "Fefe_du_973"; }
export function Size() { return [1, 1]; }
export function DefaultPosition() { return [0, 70]; }
export function DefaultScale() { return 1.0; }
export function ControllableParameters() {
	return [
		{ "property": "shutdownColor", "group": "lighting", "label": "Shutdown Color", "min": "0", "max": "360", "type": "color", "default": "#009bde" },
		{ "property": "LightingMode", "group": "lighting", "label": "Lighting Mode", "type": "combobox", "values": ["Canvas", "Forced"], "default": "Canvas" },
		{ "property": "forcedColor", "group": "lighting", "label": "Forced Color", "min": "0", "max": "360", "type": "color", "default": "#009bde" }
	];
}

let protocol;

export function Initialize() {
	device.setName(controller.name)
	device.ControllableParameters
	device.setSize(10, 10)
	device.setControllableLeds(["LED 1"], [[0, 0]]);
	protocol = new OpenRGBProtocol(controller);
}

export function Render() {
	let color;

	if (LightingMode === "Forced") {
		color = hexToRgb(forcedColor);
	} else {
		color = device.color(0, 0);
	}

		protocol.setColors(color[0], color[1], color[2]);
		device.pause(2);
}

export function Shutdown() {
	device.pause(5000);
	let color = hexToRgb(shutdownColor);
	protocol.setColors(color[0], color[1], color[2]);
	device.pause(5000);
}


export function DiscoveryService() {

	this.IconUrl = 'data:image/png;base64,' + logo;
	this.connect = function (devices) {
		for (let i = 0; i < devices.length; i++) {
			this.AddDevice(devices[i]);
		}
	};

	this.removedDevices = function (deviceId) {
		let controller = service.getController(deviceId);
		service.removeController(controller);
		service.suppressController(controller);
	}

	this.AddDevice = function (device) {
		service.addController(new OpenRGBDevice(device));
	};

	this.Update = function () {
		return;
	};
}

class OpenRGBDevice {
	constructor(device) {
		this.id = device.deviceId;
		this.name = device.name;
		this.colors = device.colors;
		this.update();
	}

	update() {
		service.log("Updating device: " + this.name);
		service.log("Device ID: " + this.id);
		const controller = service.getController(this.id)
		if (controller === undefined) {
			service.addController(this);
			service.announceController(this);
		} else {
			service.updateController(this);
		}
	};
}

class OpenRGBProtocol {
	constructor(device) {
		this.deviceId = device.id;
		this.colors = device.colors;
		this.host = '127.0.0.1'
		this.port = 6742
	}


	setColors(r, g, b) {
		const xhr = new XMLHttpRequest();
		let colors = Array(this.colors.length).fill({
			red: r,
			green: g,
			blue: b
		})
		xhr.open("GET", `http://localhost:9730/setColors?host=${this.host}&port=${this.port}&colors=${JSON.stringify(colors)}&deviceId=${this.deviceId}`, true);
		xhr.onreadystatechange = function () {
			if (xhr.readyState === 4 && xhr.status === 200) {
				return;
			}
		};
		xhr.send();
	}
}

function hexToRgb(hex) {
	const result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	const colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);
	return colors;
}

let logo = ''